import classes from './takeAttendance.module.css'
import Button from '../../UI/button/Button';

const TakeAttendance = () => {
    return(
        <div>
            <Button className={classes.button}>Mark Attendance</Button>
        </div>
    )
}

export default TakeAttendance;
